## Steps to Reproduce

Launched my application in the Android simulator.
This error started showing up after added some new code to test out isolates / background jobs.
See the // new tags in the code below.

---------------
import 'package:flutter/material.dart';
import 'default_route.dart';
import 'TimeChart.dart';
import "dart:io";
import 'package:flutter/foundation.dart';
import 'dart:async';

//add import to rendering library (for debugPaintSizeEnabled)
import 'package:flutter/rendering.dart';


void main() async{
  //debugPaintSizeEnabled=true;
  compute(_backgroundJob,0); // new
  runApp(App());
}


class App extends StatelessWidget {
  @override
   Widget build(BuildContext context) {
    print("in App:build");
    return MaterialApp(
      debugShowCheckedModeBanner: true,
      title: 'My Application',
      theme: ThemeData(
        primaryColor: Colors.blue,
        dialogBackgroundColor: Colors.blue,
      ),
      home: DefaultRoute(),
    );
  }
}

// new
Future<String> _backgroundJob(int dummy) async {
  print("starting backgroundJob");
  while (true) {
    print("in backgroundJob");
    sleep(Duration(seconds: 10));
  }
  return "done";
}

